import React, { Component } from "react";
import Layout from "../components/Layout";
import { Segment, Header, Image, List } from "semantic-ui-react";

class index extends Component {
  render() {
    return (
      <Layout>
        <Segment
          style={{
            margin: "",
            backgroundColor: "black",
            padding: "10% 0 10% 0",
            width: "100%",
          }}
        >
          <div style={{ textAlign: "center" }}>
            <List inverted horizontal>
              <List.Item>
                <Header as="h1" content="SECURITY IN YOUR HANDS" />
              </List.Item>
              <List.Item>
                <Header as="h2" inverted icon="lock" />
              </List.Item>
            </List>
          </div>
          <Header
            inverted
            textAlign="center"
            as="h1"
            content="Get your secure wallet today!"
          />
        </Segment>
      </Layout>
    );
  }
}

export default index;
